http://www.w3.org/2000/01/rdf-schema#com.@value:
A Distance should have two distance points and a distance value. eg:

<distances/a/b>
    a ov:Distance ;
    ov:distancePoint <a> , <b> ;
    ov:kilometres 0.5 ;
.

http://open.vocab.org/terms/markdownDesc.@value:
For example:

    []
      rdf:type openvocab:IllegalRDFXMLStatement ;
      rdf:subject <http://example.com/some_competition> ;
      rdf:predicate <http://example.com/prizes/1> ;
      rdf:object <http://example.com/some_person> .

Tools *may* automatically convert between openvocab:IllegalRDFXMLStatement statements and unreified statements when parsing or serialising RDF/XML.
